import React, { Component } from 'react';

export default class HeaderInfo extends Component {

    render() {
        return (
            <>
            <div>
                <h3>Geocacher</h3>
            </div>
                <div>
                    <h2>Current Location</h2>
                </div>
            </>
        )
    }

}


